   132‚Üí      elbow_angle: acc.elbow_angle + m.elbow_angle / metricsHistory.length,
   133‚Üí      knee_angle: acc.knee_angle + m.knee_angle / metricsHistory.length,
   134‚Üí      stance_width_norm: acc.stance_width_norm + m.stance_width_norm / metricsHistory.length,
