   136‚Üí        acc.shoulder_hip_rotation_proxy + m.shoulder_hip_rotation_proxy / metricsHistory.length,
   137‚Üí    }),
   138‚Üí    { elbow_angle: 0, knee_angle: 0, stance_width_norm: 0, shoulder_hip_rotation_proxy: 0 }
   139‚Üí  );
