   141‚Üí  const prompt = `You are an expert badminton coach analyzing a player's form from video metrics.
   142‚Üí
   143‚ÜíAggregated metrics from the video analysis:
   144‚Üí- Average elbow angle: ${avgMetrics.elbow_angle.toFixed(1)}¬∞ (ideal: 90-120¬∞ for clear shots)
   145‚Üí- Average knee angle: ${avgMetrics.knee_angle.toFixed(1)}¬∞ (ideal: 120-150¬∞ for ready position)
   146‚Üí- Average stance width: ${avgMetrics.stance_width_norm.toFixed(2)} (ideal: 0.3-0.5 shoulder widths)
   147‚Üí- Average rotation proxy: ${avgMetrics.shoulder_hip_rotation_proxy.toFixed(2)} (ideal: 0.1-0.3)
   148‚Üí- Total frames analyzed: ${metricsHistory.length}
   149‚Üí
   150‚Üí${videoContext ? `Video context: ${videoContext}` : ''}
   151‚Üí
   152‚ÜíProvide a comprehensive analysis including:
   153‚Üí1. Top 2-3 issues to address (with severity: high/medium/low)
   154‚Üí2. 2-3 specific drills to improve these issues
   155‚Üí3. A technique summary paragraph
   156‚Üí4. A strategy summary paragraph
   157‚Üí5. A 5-day training plan
   158‚Üí
   159‚ÜíBe specific, actionable, and encouraging.`;
