   211‚Üí// Racket recommendation with Gemini
   212‚Üíexport async function getRacketRecommendations(
   213‚Üí  rackets: Racket[],
   214‚Üí  level: string,
   215‚Üí  weaknesses: string[],
   216‚Üí  stylePref?: string
   217‚Üí): Promise<RacketRecommendation[]> {
   218‚Üí  const prompt = `You are a badminton equipment expert helping select rackets.
   219‚Üí
   220‚ÜíPlayer profile:
   221‚Üí- Skill level: ${level}
   222‚Üí- Areas to improve: ${weaknesses.join(', ')}
   223‚Üí- Playing style preference: ${stylePref || 'not specified'}
   224‚Üí
   225‚ÜíAvailable rackets:
   226‚Üí${rackets.map((r, i) => `${i + 1}. ${r.name} (id: "${r.id}") by ${r.brand}
   227‚Üí   - Price: ${r.price_range} (${r.price_band})
   228‚Üí   - For: ${r.skill_level.join(', ')} players
   229‚Üí   - Style: ${r.play_style.join(', ')}
   230‚Üí   - Weight: ${r.weight}, Balance: ${r.balance}, Flex: ${r.flexibility}
   231‚Üí`).join('\n')}
   232‚Üí
   233‚ÜíRank the top 5 rackets for this player. For each, provide the racket "id" exactly as shown, a match_score (0-100), and a brief match_reason (1-2 sentences).
   234‚ÜíReturn as JSON array: [{"id": "racket-id-here", "match_score": 85, "match_reason": "explanation"}]`;
   235‚Üí
   236‚Üí  try {
   237‚Üí    const response = await genAI.models.generateContent({
   238‚Üí      model: FLASH_MODEL,
   239‚Üí      contents: prompt,
   240‚Üí      config: {
   241‚Üí        responseMimeType: 'application/json',
   242‚Üí        temperature: 0.3,
   243‚Üí        maxOutputTokens: 500,
   244‚Üí      },
   245‚Üí    });
   246‚Üí
   247‚Üí    const rankings = JSON.parse(response.text || '[]');
   248‚Üí
   249‚Üí    // Merge rankings with racket data
   250‚Üí    return rankings.slice(0, 5).map((rank: { id: string; match_score: number; match_reason: string }) => {
   251‚Üí      const racket = rackets.find((r) => r.id === rank.id) || rackets[0];
   252‚Üí      return {
   253‚Üí        ...racket,
   254‚Üí        match_score: rank.match_score || 75,
   255‚Üí        match_reason: rank.match_reason || 'Good all-around choice for your level.',
   256‚Üí      };
   257‚Üí    });
   258‚Üí  } catch (error) {
   259‚Üí    console.error('Gemini ranking error:', error);
   260‚Üí    // Fallback: deterministic ranking
   261‚Üí    return getFallbackRacketRecommendations(rackets, level, stylePref);
   262‚Üí  }
   263‚Üí}
