   306‚Üí      target_metrics: ['knee_angle', 'stance_width_norm'],
   307‚Üí      instructions: [
   308‚Üí        'Start in ready position with slight knee bend',
   309‚Üí        'Partner calls direction, you shuffle',
   310‚Üí        'Return to ready position',
   311‚Üí        'Focus on consistent knee angle',
   312‚Üí      ],
   313‚Üí    });
   314‚Üí  }
   315‚Üí
   316‚Üí  if (issues.length === 0) {
   317‚Üí    issues.push({
