   331‚Üí      duration_minutes: 15,
   332‚Üí      target_metrics: ['elbow_angle', 'knee_angle'],
   333‚Üí      instructions: [
   334‚Üí        'Rally with partner using only clears',
   335‚Üí        'Focus on consistent contact point',
