   348‚Üí      { day: 2, focus: 'Swing Mechanics', drills: ['drill-shadow'], duration_minutes: 25 },
   349‚Üí      { day: 3, focus: 'Combined Practice', drills: drills.map((d) => d.id), duration_minutes: 40 },
   350‚Üí      { day: 4, focus: 'Rest & Review', drills: [], duration_minutes: 0 },
   351‚Üí      { day: 5, focus: 'Match Play', drills: ['drill-rally'], duration_minutes: 45 },
