   356‚Üí// Fallback racket recommendations
   357‚Üífunction getFallbackRacketRecommendations(
   358‚Üí  rackets: Racket[],
   359‚Üí  level: string,
   360‚Üí  stylePref?: string
   361‚Üí): RacketRecommendation[] {
   362‚Üí  // Simple scoring based on matching criteria
   363‚Üí  const scored = rackets.map((racket) => {
   364‚Üí    let score = 50;
   365‚Üí
   366‚Üí    // Level match
   367‚Üí    if (racket.skill_level.includes(level)) score += 20;
   368‚Üí
   369‚Üí    // Style match
   370‚Üí    if (stylePref && racket.play_style.includes(stylePref)) score += 15;
   371‚Üí
   372‚Üí    // Beginner-friendly adjustments
   373‚Üí    if (level === 'beginner') {
   374‚Üí      if (racket.flexibility === 'Flexible') score += 10;
   375‚Üí      if (racket.price_band === 'budget') score += 5;
   376‚Üí    }
   377‚Üí
   378‚Üí    // Advanced adjustments
   379‚Üí    if (level === 'advanced') {
   380‚Üí      if (racket.flexibility === 'Stiff') score += 10;
   381‚Üí      if (racket.price_band === 'premium') score += 5;
   382‚Üí    }
   383‚Üí
   384‚Üí    return {
   385‚Üí      ...racket,
   386‚Üí      match_score: Math.min(score, 100),
   387‚Üí      match_reason: `Good match for ${level} players seeking ${stylePref || 'versatile'} play.`,
   388‚Üí    };
   389‚Üí  });
   390‚Üí
   391‚Üí  return scored
   392‚Üí    .sort((a, b) => b.match_score - a.match_score)
   393‚Üí    .slice(0, 5);
   394‚Üí}
