import { createClient, SupabaseClient } from '@supabase/supabase-js';
import * as tus from 'tus-js-client';

const supabaseUrl = process.env.NEXT_PUBLIC_SUPABASE_URL || '';
const supabaseAnonKey = process.env.NEXT_PUBLIC_SUPABASE_ANON_KEY || '';

/**
 * Wrapper to handle AbortError from Supabase auth locks.
 * When the auth lock's AbortController is aborted before acquisition,
 * this retries the operation once after a short delay.
 */
async function withLockErrorHandling<T>(fn: () => Promise<T>): Promise<T> {
  try {
    return await fn();
  } catch (error) {
    if (error instanceof Error && error.name === 'AbortError') {
      console.warn('Auth lock aborted, retrying...', error);
      // Retry once after a short delay
      await new Promise(resolve => setTimeout(resolve, 100));
      return await fn();
    }
    throw error;
  }
}

// Constants for upload handling
const RESUMABLE_THRESHOLD = 6 * 1024 * 1024; // 6MB - use TUS for files larger than this
const MAX_FILE_SIZE = 50 * 1024 * 1024; // 50MB max file size (Supabase free tier limit)
const STORAGE_BUCKET = 'videos';

// Helper to format file size for user-friendly display
function formatFileSize(bytes: number): string {
  if (bytes < 1024) return bytes + ' B';
  if (bytes < 1024 * 1024) return (bytes / 1024).toFixed(1) + ' KB';
  return (bytes / (1024 * 1024)).toFixed(1) + ' MB';
}
const PRACTICE_RECORDINGS_BUCKET = 'practice-recordings';

// Client-side Supabase client (lazy initialization)
let _supabase: SupabaseClient | null = null;

export const supabase = (() => {
  if (!_supabase && supabaseUrl && supabaseAnonKey) {
    _supabase = createClient(supabaseUrl, supabaseAnonKey);
  }
  // Return a mock client if env vars not available (for SSR)
  if (!_supabase) {
    return createClient(
      supabaseUrl || 'https://placeholder.supabase.co',
      supabaseAnonKey || 'placeholder-key'
    );
  }
  return _supabase;
})();

// Server-side Supabase client (for API routes)
export function createServerClient() {
  const url = process.env.NEXT_PUBLIC_SUPABASE_URL || supabaseUrl;
  const key = process.env.NEXT_PUBLIC_SUPABASE_ANON_KEY || supabaseAnonKey;

