   364‚Üí      { day: 3, focus: 'Combined Practice', drills: drills.map((d) => d.id), duration_minutes: 40 },
   365‚Üí      { day: 4, focus: 'Rest & Review', drills: [], duration_minutes: 0 },
   366‚Üí      { day: 5, focus: 'Match Play', drills: ['drill-rally'], duration_minutes: 45 },
   367‚Üí    ],
   368‚Üí  };
   369‚Üí}
