   371‚Üí// Fallback racket recommendations
   372‚Üífunction getFallbackRacketRecommendations(
   373‚Üí  rackets: Racket[],
   374‚Üí  level: string,
   375‚Üí  stylePref?: string
   376‚Üí): RacketRecommendation[] {
   377‚Üí  // Simple scoring based on matching criteria
   378‚Üí  const scored = rackets.map((racket) => {
   379‚Üí    let score = 50;
   380‚Üí
   381‚Üí    // Level match
   382‚Üí    if (racket.skill_level.includes(level)) score += 20;
   383‚Üí
   384‚Üí    // Style match
   385‚Üí    if (stylePref && racket.play_style.includes(stylePref)) score += 15;
   386‚Üí
   387‚Üí    // Beginner-friendly adjustments
   388‚Üí    if (level === 'beginner') {
   389‚Üí      if (racket.flexibility === 'Flexible') score += 10;
   390‚Üí      if (racket.price_band === 'budget') score += 5;
   391‚Üí    }
   392‚Üí
   393‚Üí    // Advanced adjustments
   394‚Üí    if (level === 'advanced') {
   395‚Üí      if (racket.flexibility === 'Stiff') score += 10;
   396‚Üí      if (racket.price_band === 'premium') score += 5;
   397‚Üí    }
   398‚Üí
   399‚Üí    return {
   400‚Üí      ...racket,
   401‚Üí      match_score: Math.min(score, 100),
   402‚Üí      match_reason: `Good match for ${level} players seeking ${stylePref || 'versatile'} play.`,
   403‚Üí    };
   404‚Üí  });
   405‚Üí
   406‚Üí  return scored
   407‚Üí    .sort((a, b) => b.match_score - a.match_score)
   408‚Üí    .slice(0, 5);
   409‚Üí}
