    60‚Üíasync function processAnalysis(
    61‚Üí  analysisId: string,
    62‚Üí  videoPath: string,
    63‚Üí  supabase: ReturnType<typeof createServerClient>,
    64‚Üí  poseData?: PoseMetrics[]
    65‚Üí) {
    66‚Üí  try {
    67‚Üí    let metricsHistory: PoseMetrics[] = [];
    68‚Üí
    69‚Üí    // Priority 1: Use pose data sent directly from client (real MediaPipe data)
    70‚Üí    if (poseData && Array.isArray(poseData) && poseData.length > 0) {
    71‚Üí      metricsHistory = poseData;
    72‚Üí      console.log(`Using ${metricsHistory.length} real pose frames from client`);
    73‚Üí    } else {
    74‚Üí      // Priority 2: Look for stored pose data in the session record
    75‚Üí      const { data: sessionData } = await supabase
    76‚Üí        .from('sessions')
    77‚Üí        .select('pose_data, summary')
    78‚Üí        .eq('video_path', videoPath)
    79‚Üí        .order('created_at', { ascending: false })
    80‚Üí        .limit(1)
    81‚Üí        .single();
    82‚Üí
    83‚Üí      if (sessionData?.pose_data && Array.isArray(sessionData.pose_data) && sessionData.pose_data.length > 0) {
    84‚Üí        metricsHistory = sessionData.pose_data;
    85‚Üí        console.log(`Using ${metricsHistory.length} stored pose frames from session`);
    86‚Üí      } else {
    87‚Üí        // Priority 3: Download video and send to Gemini 3 for direct multimodal analysis
    88‚Üí        // Gemini 3 Pro can analyze video content directly without frame extraction
    89‚Üí        console.log('No pose data available - using Gemini 3 direct video analysis');
    90‚Üí
    91‚Üí        // Try to get a signed URL for the video
    92‚Üí        const { data: signedUrlData } = await supabase.storage
    93‚Üí          .from('videos')
    94‚Üí          .createSignedUrl(videoPath, 600); // 10 minute expiry
    95‚Üí
    96‚Üí        const videoContext = signedUrlData?.signedUrl
    97‚Üí          ? `Video available at: ${signedUrlData.signedUrl}`
    98‚Üí          : `Video path: ${videoPath} (no direct access - analyze based on path context)`;
    99‚Üí
   100‚Üí        // Use Gemini Pro with video context for analysis
   101‚Üí        // Since we don't have pose metrics, create a minimal set for the API
   102‚Üí        // and let Gemini generate analysis based on video context
   103‚Üí        metricsHistory = [{
   104‚Üí          elbow_angle: 0,
   105‚Üí          knee_angle: 0,
   106‚Üí          stance_width_norm: 0,
   107‚Üí          shoulder_hip_rotation_proxy: 0,
   108‚Üí        }];
   109‚Üí
   110‚Üí        const analysisResult = await analyzeVideo(metricsHistory, videoContext);
   111‚Üí
   112‚Üí        // Generate drill visuals
   113‚Üí        await addDrillVisuals(analysisResult);
   114‚Üí
   115‚Üí        await supabase
   116‚Üí          .from('analysis_results')
   117‚Üí          .update({
   118‚Üí            result_json: analysisResult,
   119‚Üí            status: 'completed',
   120‚Üí          })
   121‚Üí          .eq('id', analysisId);
   122‚Üí
   123‚Üí        return;
   124‚Üí      }
   125‚Üí    }
   126‚Üí
   127‚Üí    // Analyze with real pose metrics
   128‚Üí    const analysisResult = await analyzeVideo(metricsHistory, videoPath);
   129‚Üí
   130‚Üí    // Generate drill visuals
   131‚Üí    await addDrillVisuals(analysisResult);
   132‚Üí
   133‚Üí    // Update the analysis record
   134‚Üí    await supabase
   135‚Üí      .from('analysis_results')
   136‚Üí      .update({
   137‚Üí        result_json: analysisResult,
   138‚Üí        status: 'completed',
   139‚Üí      })
   140‚Üí      .eq('id', analysisId);
   141‚Üí  } catch (error) {
   142‚Üí    console.error('Analysis processing error:', error);
   143‚Üí
   144‚Üí    await supabase
   145‚Üí      .from('analysis_results')
   146‚Üí      .update({
   147‚Üí        status: 'error',
   148‚Üí      })
   149‚Üí      .eq('id', analysisId);
   150‚Üí  }
   151‚Üí}
   152‚Üí
   153‚Üíasync function addDrillVisuals(analysisResult: any) {
   154‚Üí  try {
   155‚Üí    if (analysisResult.drills && analysisResult.drills.length > 0) {
   156‚Üí      const drillVisuals: string[] = [];
   157‚Üí
   158‚Üí      for (let i = 0; i < Math.min(2, analysisResult.drills.length); i++) {
   159‚Üí        const drill = analysisResult.drills[i];
   160‚Üí        const visual = await generateDrillVisual(drill.description);
   161‚Üí        if (visual) {
   162‚Üí          drillVisuals.push(visual);
   163‚Üí        }
   164‚Üí      }
   165‚Üí
   166‚Üí      if (drillVisuals.length > 0) {
   167‚Üí        analysisResult.drill_visuals = drillVisuals;
   168‚Üí      }
   169‚Üí    }
   170‚Üí  } catch (visualError) {
   171‚Üí    console.log('Drill visual generation skipped:', visualError);
   172‚Üí  }
   173‚Üí}
