     1‚Üíimport { NextResponse } from 'next/server';
     2‚Üíimport { getCoachingCue } from '@/lib/gemini';
     3‚Üíimport { evaluateMetrics, DEFAULT_THRESHOLDS } from '@/lib/pose-utils';
     4‚Üíimport type { TickRequest, TickResponse, PoseMetrics } from '@/lib/types';
     5‚Üí
     6‚Üí// Cache for rate limiting Gemini calls
     7‚Üílet lastGeminiCall = 0;
     8‚Üíconst GEMINI_CALL_INTERVAL = 2000; // Minimum 2 seconds between Gemini calls
     9‚Üílet cachedResponse: { cue: string; focus_metric: string; commentary?: string; reason?: string; latency_ms?: number } | null = null;
    10‚Üí
    11‚Üíexport async function POST(request: Request) {
    12‚Üí  try {
    13‚Üí    const body: TickRequest = await request.json();
    14‚Üí    const { metrics_snapshot, drill_id } = body;
    15‚Üí
    16‚Üí    if (!metrics_snapshot) {
    17‚Üí      return NextResponse.json(
    18‚Üí        { error: 'metrics_snapshot is required' },
    19‚Üí        { status: 400 }
    20‚Üí      );
    21‚Üí    }
    22‚Üí
    23‚Üí    const metrics: PoseMetrics = metrics_snapshot;
    24‚Üí
    25‚Üí    // Evaluate metrics locally first
    26‚Üí    const { isGreen, feedback } = evaluateMetrics(metrics);
    27‚Üí
    28‚Üí    // Determine if we should call Gemini (rate limited)
    29‚Üí    const now = Date.now();
    30‚Üí    const shouldCallGemini = now - lastGeminiCall > GEMINI_CALL_INTERVAL;
    31‚Üí
    32‚Üí    let cue = feedback[0];
    33‚Üí    let focusMetric = determineFocusMetric(metrics);
    34‚Üí    let commentary = '';
    35‚Üí    let reason = '';
    36‚Üí    let latency_ms: number | undefined;
    37‚Üí
    38‚Üí    if (shouldCallGemini && process.env.GEMINI_API_KEY) {
    39‚Üí      try {
    40‚Üí        lastGeminiCall = now;
    41‚Üí
    42‚Üí        const drillContext = drill_id
    43‚Üí          ? `Practicing drill: ${drill_id}`
    44‚Üí          : undefined;
    45‚Üí
    46‚Üí        const geminiResult = await getCoachingCue(metrics, drillContext);
    47‚Üí        cue = geminiResult.cue;
    48‚Üí        focusMetric = geminiResult.focus_metric;
    49‚Üí        commentary = geminiResult.commentary;
    50‚Üí        reason = geminiResult.reason;
    51‚Üí        latency_ms = geminiResult.latency_ms;
    52‚Üí
    53‚Üí        // Cache the response
    54‚Üí        cachedResponse = { cue, focus_metric: focusMetric, commentary, reason, latency_ms };
    55‚Üí      } catch (error) {
    56‚Üí        console.error('Gemini error, using fallback:', error);
    57‚Üí        if (cachedResponse) {
    58‚Üí          cue = cachedResponse.cue;
    59‚Üí          focusMetric = cachedResponse.focus_metric;
    60‚Üí          commentary = cachedResponse.commentary || '';
    61‚Üí          reason = cachedResponse.reason || '';
    62‚Üí          latency_ms = cachedResponse.latency_ms;
    63‚Üí        }
    64‚Üí      }
    65‚Üí    } else if (cachedResponse && !shouldCallGemini) {
    66‚Üí      cue = cachedResponse.cue;
    67‚Üí      focusMetric = cachedResponse.focus_metric;
    68‚Üí      commentary = cachedResponse.commentary || '';
    69‚Üí      reason = cachedResponse.reason || '';
    70‚Üí      latency_ms = cachedResponse.latency_ms;
    71‚Üí    }
    72‚Üí
    73‚Üí    const response: TickResponse = {
    74‚Üí      cue,
    75‚Üí      focus_metric: focusMetric,
    76‚Üí      green_thresholds: DEFAULT_THRESHOLDS,
    77‚Üí      is_green: isGreen,
    78‚Üí      commentary,
    79‚Üí      reason,
    80‚Üí      latency_ms,
    81‚Üí    };
    82‚Üí
    83‚Üí    return NextResponse.json(response);
    84‚Üí  } catch (error) {
    85‚Üí    console.error('Practice tick error:', error);
    86‚Üí    return NextResponse.json(
    87‚Üí      { error: 'Failed to process tick' },
    88‚Üí      { status: 500 }
    89‚Üí    );
    90‚Üí  }
    91‚Üí}
    92‚Üí
    93‚Üífunction determineFocusMetric(metrics: PoseMetrics): string {
    94‚Üí  const issues: { metric: string; deviation: number }[] = [];
    95‚Üí
    96‚Üí  // Check elbow angle (ideal: 90-120)
    97‚Üí  if (metrics.elbow_angle < 90) {
    98‚Üí    issues.push({
    99‚Üí      metric: 'elbow_angle',
   100‚Üí      deviation: 90 - metrics.elbow_angle,
   101‚Üí    });
   102‚Üí  } else if (metrics.elbow_angle > 120) {
   103‚Üí    issues.push({
   104‚Üí      metric: 'elbow_angle',
   105‚Üí      deviation: metrics.elbow_angle - 120,
   106‚Üí    });
   107‚Üí  }
   108‚Üí
   109‚Üí  // Check knee angle (ideal: 120-150)
   110‚Üí  if (metrics.knee_angle < 120) {
   111‚Üí    issues.push({
   112‚Üí      metric: 'knee_angle',
   113‚Üí      deviation: 120 - metrics.knee_angle,
   114‚Üí    });
   115‚Üí  } else if (metrics.knee_angle > 150) {
   116‚Üí    issues.push({
   117‚Üí      metric: 'knee_angle',
   118‚Üí      deviation: metrics.knee_angle - 150,
   119‚Üí    });
   120‚Üí  }
   121‚Üí
   122‚Üí  // Check stance width (ideal: 0.3-0.5)
   123‚Üí  if (metrics.stance_width_norm < 0.3) {
   124‚Üí    issues.push({
   125‚Üí      metric: 'stance_width_norm',
   126‚Üí      deviation: (0.3 - metrics.stance_width_norm) * 100, // Scale up for comparison
   127‚Üí    });
   128‚Üí  } else if (metrics.stance_width_norm > 0.5) {
   129‚Üí    issues.push({
   130‚Üí      metric: 'stance_width_norm',
   131‚Üí      deviation: (metrics.stance_width_norm - 0.5) * 100,
   132‚Üí    });
   133‚Üí  }
   134‚Üí
   135‚Üí  // Check rotation (ideal: 0.1-0.3)
   136‚Üí  if (metrics.shoulder_hip_rotation_proxy < 0.1) {
   137‚Üí    issues.push({
   138‚Üí      metric: 'shoulder_hip_rotation_proxy',
   139‚Üí      deviation: (0.1 - metrics.shoulder_hip_rotation_proxy) * 100,
   140‚Üí    });
   141‚Üí  } else if (metrics.shoulder_hip_rotation_proxy > 0.3) {
   142‚Üí    issues.push({
   143‚Üí      metric: 'shoulder_hip_rotation_proxy',
   144‚Üí      deviation: (metrics.shoulder_hip_rotation_proxy - 0.3) * 100,
   145‚Üí    });
   146‚Üí  }
   147‚Üí
   148‚Üí  // Return the metric with the largest deviation, or a default
   149‚Üí  if (issues.length === 0) {
   150‚Üí    return 'general_form';
   151‚Üí  }
   152‚Üí
   153‚Üí  issues.sort((a, b) => b.deviation - a.deviation);
   154‚Üí  return issues[0].metric;
   155‚Üí}
