### HIGH PRIORITY ISSUES

#### [HIGH] Type Mismatch: TickResponse Missing green_thresholds Property
**File:** `/rallycoach/src/lib/types.ts:125-135` vs `/rallycoach/src/app/api/practice/tick/route.ts:73-81`

The `TickResponse` interface defines:
```typescript
export interface TickResponse {
  cue: string;
  focus_metric: string;
  green_thresholds: { [key: string]: { min: number; max: number } };  // DEFINED
  is_green: boolean;
  commentary?: string;
  reason?: string;
  latency_ms?: number;
}
```

But `getCoachingCue()` in gemini.ts returns a type WITHOUT `green_thresholds`. The route then adds it afterward:
```typescript
const response: TickResponse = {
  cue,
  focus_metric: focusMetric,
  green_thresholds: DEFAULT_THRESHOLDS,  // Added here
  is_green: isGreen,
  // ...
};
```

**Issue:** Type safety is broken. The actual Gemini response doesn't include `green_thresholds`, but the API contract requires it. If `DEFAULT_THRESHOLDS` is ever removed or becomes undefined, the API silently breaks.

**Fix:**
```typescript
// Option 1: Update Gemini return type to match API contract
export async function getCoachingCue(...): Promise<TickResponse> {
  // Include green_thresholds in response
}

// Option 2: Separate internal type from API type
interface GeminiCoachingResponse {
  cue: string;
  focus_metric: string;
  is_green: boolean;
  commentary: string;
  reason: string;
  latency_ms: number;
}
```

---

#### [HIGH] Race Condition: Global Cache State in Stateless Route
**File:** `/rallycoach/src/app/api/practice/tick/route.ts:7-9`

```typescript
let lastGeminiCall = 0;
let cachedResponse: { ... } | null = null;  // GLOBAL STATE IN ROUTE HANDLER!
```

**Issue:** These are module-level variables shared across ALL concurrent requests. This creates:
1. Race conditions where concurrent requests interfere with each other
2. Cache contamination between different users/sessions
3. Impossible to scale with multiple server instances

**Fix:**
```typescript
// Use request headers or session storage instead
export async function POST(request: Request) {
  const sessionId = request.headers.get('x-session-id');

  // Use Redis, request context, or database for cache
  const cacheKey = `tick-cache:${sessionId}`;
  const cachedData = await redis.get(cacheKey);
}
```

