#### [HIGH] Mock Data Leakage to Production Paths
**File:** `/rallycoach/src/app/practice/page.tsx:43, 131-133, 312-326`

```typescript
const useMockDataRef = useRef(false);
// ...
if (useMockData) {
  // Generate mock data for demo
  const metrics = generateMockMetrics();
```

**Issue:** The component silently switches to mock data when MediaPipe fails, without clear indication that the backend receives FAKE data. Session gets saved with synthetic metrics.

**Fix:**
```typescript
// Don't save sessions when using mock data
if (useMockData && isRecording) {
  setRecordingEnabled(false);
  console.warn('Recording disabled in demo mode');
}

// Track in DB
await supabase
  .from('sessions')
  .update({
    // ... other fields
    is_demo: useMockData,  // Flag demo sessions
    summary: {
      // ... 
      note: useMockData ? 'Demo mode - synthetic data' : undefined,
    },
  })
  .eq('id', sessionIdRef.current);
```

---

#### [HIGH] Unsafe Bearer Token Extraction
**File:** `/rallycoach/src/app/api/analysis/start/route.ts:25-29`

```typescript
if (authHeader?.startsWith('Bearer ')) {
  const token = authHeader.split(' ')[1];
  const { data: { user } } = await supabase.auth.getUser(token);
  userId = user?.id || null;
}
```

**Issue:** 
1. No validation of token format (what if index [1] is undefined?)
2. Passes raw token to Supabase without verification
3. No error handling for invalid tokens
4. Falls back to demo-user on ANY failure

**Fix:**
```typescript
const getAuthenticatedUser = async (authHeader: string | null) => {
  if (!authHeader?.startsWith('Bearer ')) {
    return null;
  }

  const token = authHeader.split(' ')[1];
  if (!token || token.length < 10) {
    console.warn('Invalid token format');
    return null;
  }

  try {
    const { data: { user }, error } = await supabase.auth.getUser(token);
    if (error) {
      console.error('Auth error:', error.message);
      return null;
    }
    return user?.id || null;
  } catch (error) {
    console.error('Token verification failed:', error);
    return null;
  }
};
```

