### MEDIUM PRIORITY ISSUES

#### [MEDIUM] Fallback Analysis Returns Mock Data Without Warning
**File:** `/rallycoach/src/lib/gemini.ts:281-369`

```typescript
function getFallbackAnalysis(avgMetrics: PoseMetrics): AnalysisResultJson {
  // Returns synthetic data with no indication it's not AI-generated
```

**Issue:** When Gemini fails, the fallback analysis is indistinguishable from real AI analysis. Users think they're getting AI coaching when they're getting hardcoded responses.

