#### [MEDIUM] Missing Input Validation: Video Path Traversal Risk
**File:** `/rallycoach/src/app/api/analysis/start/route.ts:9, 92-94`

```typescript
const { video_path, pose_data } = await request.json();

if (!video_path) {
  // Only checks if empty, not if it's a valid path
