**Fix:**
```typescript
function validateVideoPath(path: string): boolean {
  if (!path || typeof path !== 'string') return false;
  if (path.includes('..') || path.includes('//') || path.startsWith('/')) return false;
  if (!path.startsWith(userId + '/')) return false; // Ensure user-scoped
  return /^[a-zA-Z0-9_/-]+\.[a-z]{3,4}$/.test(path); // Allow only safe chars
}

if (!validateVideoPath(video_path)) {
  return NextResponse.json(
    { error: 'Invalid video path' },
    { status: 400 }
  );
}
