**File:** `/rallycoach/src/lib/types.ts:125-135` vs `/rallycoach/src/app/api/practice/tick/route.ts:73-81`

The `TickResponse` interface defines:
```typescript
export interface TickResponse {
  cue: string;
  focus_metric: string;
  green_thresholds: { [key: string]: { min: number; max: number } };  // DEFINED
  is_green: boolean;
