  cue,
  focus_metric: focusMetric,
  green_thresholds: DEFAULT_THRESHOLDS,  // Added here
  is_green: isGreen,
  // ...
};
```

**Issue:** Type safety is broken. The actual Gemini response doesn't include `green_thresholds`, but the API contract requires it. If `DEFAULT_THRESHOLDS` is ever removed or becomes undefined, the API silently breaks.

**Fix:**
```typescript
// Option 1: Update Gemini return type to match API contract
export async function getCoachingCue(...): Promise<TickResponse> {
  // Include green_thresholds in response
}

