      model: 'gemini-2.5-flash',
      contents: 'Badminton coach. Elbow 160. Give coaching cue.',
      config: {
        responseMimeType: 'application/json',
        responseSchema: {
          type: Type.OBJECT,
          properties: {
            cue: { type: Type.STRING },
            focus_metric: { type: Type.STRING },
            is_green: { type: Type.BOOLEAN },
            commentary: { type: Type.STRING },
            reason: { type: Type.STRING },
